<?php

namespace ShineUnited\Silex\Timeline\Tests;

use ShineUnited\Silex\Timeline\Timeline;
use ShineUnited\Silex\Timeline\TimelineExtension;


class TimelineExtensionTest extends \PHPUnit_Framework_TestCase {

	/**
	 *	@dataProvider	twigOutputProvider
	 */
	public function testTwigOutput($now, $twig, $expect) {
		$timeline = new Timeline('UTC', [
			'perigee'  => '12-Dec-2016 23:28:00',
			'fullmoon' => '14-Dec-2016 00:07:00',
			'apogee'   => '25-Dec-2016 05:56:00',
			'newmoon'  => '29-Dec-2016 06:54:00'
		]);

		$timeline->offsetSet('now', $now);

		$loader = new \Twig_Loader_Array([
			'test' => $twig
		]);

		$twig = new \Twig_Environment($loader);
		$twig->addExtension(new TimelineExtension($timeline));

		$template = $twig->load('test');
		$this->assertEquals($expect, $template->render());
	}

